import React from "react"
import {TextField, TextFieldProps} from "@material-ui/core"
import {FieldProps} from "formik"

interface Props extends FieldProps{
    setFieldValue
}

export const CustomField = (props:Props) => {
    return <TextField
        fullWidth
        focused={false}
        variant='outlined'
        {...props}
    />
};
